INSERT INTO `blog_post` VALUES (3,'Evive - Cubes de smoothies','Evive - Cubes de smoothies','<p><em>This post is not available in english for the moment.&nbsp;</em></p>\r\n\r\n<p><em>French version below:</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>R&eacute;cemment, nous discutions des fa&ccedil;ons d&rsquo;avoir &agrave; la fois une bonne alimentation et de gagner du temps le matin. En fouillant sur internet, nous avons d&eacute;couvert la compagnie Evive.</p>\r\n\r\n<p>Cette compagnie produit des cubes de smoothie congel&eacute;es. Il s&rsquo;agit en fait de pur&eacute;e de fruits, de l&eacute;gumes et de super aliments.</p>\r\n\r\n<p><img alt=\"\" height=\"189\" src=\"https://www.alternateeve.com/upload/redactor_upload_images/1504051766_12027825_1496145894035199_4838804955488600807_n%20copie.jpg\" style=\"float:right\" title=\"\" width=\"190\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Il suffit de prendre une portion de cubes, vous les mettez dans un r&eacute;cipient, vous ajoutez le liquide de votre choix, vous attendez 15-20 min et vous brasser. &nbsp;C&rsquo;est parfait pour les gens press&eacute;s ou pour ceux qui pr&eacute;f&egrave;rent prendre leur petit-d&eacute;jeuner&nbsp;au travail. &nbsp;</p>\r\n\r\n<p>C&rsquo;&eacute;tait la premi&egrave;re fois que nous voyions une id&eacute;e semblable alors que les smoothies sont plut&ocirc;t &agrave; la mode depuis quelques ann&eacute;es. Nous avons donc contact&eacute; l&rsquo;&eacute;quipe d&rsquo;Evive afin qu&rsquo;ils nous parlent de leurs produits et qu&rsquo;ils nous racontent comment l&rsquo;entreprise est n&eacute;e.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" height=\"274\" src=\"https://www.alternateeve.com/upload/redactor_upload_images/1504053575_IMG_20170511_120011 copie.jpg\" title=\"\" width=\"205\" /></p>\r\n\r\n<p>L&rsquo;id&eacute;e de lancer des smoothies en cubes sur le march&eacute; est venu pendant les ann&eacute;es d&rsquo;universit&eacute; de la fondatrice Claudia Poulin. L&rsquo;alimentation &eacute;tait un sujet tr&egrave;s important pour elle. Elle voulait manger sainement et une des fa&ccedil;on d&rsquo;y arriver &eacute;tait de se faire des smoothies. Avec son conjoint, Dominic Dub&eacute;, ils ont eu l&rsquo;id&eacute;e des cubes afin de partager une fa&ccedil;on rapide de bien s&rsquo;alimenter avec un grand nombre de personnes. Selon eux, leur formule offre aux gens une fa&ccedil;on simple et rapide de bien manger, ce qui leur permet &eacute;galement de profiter de la vie. De l&agrave; provient leur slogan : &ldquo;Evive ta vie/More from life&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Partager leur vision de la sant&eacute; est un &eacute;l&eacute;ment cl&eacute; de leurs id&eacute;es. Les valeurs tel que le bien-&ecirc;tre, le partage et l&rsquo;harmonie ont une place centrale dans leur compagnie.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Claudia et Dominic souhaiteraient faire passer le message suivant avec leur compagnie:</p>\r\n\r\n<p>&ldquo;FAST FOOD DOESN&#39;T MEAN JUNK FOOD. Notre produit offre un fa&ccedil;on &quot;fast food&quot;, sans &ecirc;tre n&eacute;faste pour la sant&eacute;, c&#39;est m&ecirc;me b&eacute;n&eacute;fique &ldquo; - Claudia Poulin</p>\r\n\r\n<p><img alt=\"\" height=\"140\" src=\"https://www.alternateeve.com/upload/redactor_upload_images/1504053647_unnamed copie.jpg\" title=\"\" width=\"212\" /></p>\r\n\r\n<p>Les smoothies d&rsquo;Evive sont fait avec des ingr&eacute;dients biologiques. Ils sont pr&eacute;par&eacute;s au Qu&eacute;bec et lorsque possible, la compagnie&nbsp;utilise des produits locaux. &nbsp;Trois recettes de smoothies sont pr&eacute;sentement disponibles : Le guerrier (framboises, fraises, betterave, graines de chia), le touk-touk (mangue, ananas, abricot, noix de coco) et le yogi (banane, &eacute;pinard, poire, kale, graine de chanvre). Des prot&eacute;ines v&eacute;g&eacute;tales ont &eacute;t&eacute; ajout&eacute; &agrave; chacune des recettes &agrave; la demande des clients.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>En allant sur le site internet de la compagnie&nbsp;<a href=\"http://www.evivesmoothie.com/\" target=\"_blank\">Evive</a>, vous trouverez la liste compl&egrave;te des ingr&eacute;dients et &eacute;galement les points de ventes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bon smoothie!</p>\r\n\r\n<p>&nbsp;</p>','<p>R&eacute;cemment, nous discutions des fa&ccedil;ons d&rsquo;avoir &agrave; la fois une bonne alimentation et de gagner du temps le matin. En fouillant sur internet, nous avons d&eacute;couvert la compagnie Evive.</p>\r\n\r\n<p>Cette compagnie produit des cubes de smoothie congel&eacute;es. Il s&rsquo;agit en fait de pur&eacute;e de fruits, de l&eacute;gumes et de super aliments.</p>\r\n\r\n<p><img alt=\"\" height=\"189\" src=\"https://www.alternateeve.com/upload/redactor_upload_images/1504051766_12027825_1496145894035199_4838804955488600807_n%20copie.jpg\" style=\"float:right\" title=\"\" width=\"190\" /></p>\r\n\r\n<p>Il suffit de prendre une portion de cubes, vous les mettez dans un r&eacute;cipient, vous ajoutez le liquide de votre choix, vous attendez 15-20 min et vous brasser. &nbsp;C&rsquo;est parfait pour les gens press&eacute;s ou pour ceux qui pr&eacute;f&egrave;rent prendre leur petit-d&eacute;jeuner&nbsp;au travail. &nbsp;</p>\r\n\r\n<p>C&rsquo;&eacute;tait la premi&egrave;re fois que nous voyions une id&eacute;e semblable alors que les smoothies sont plut&ocirc;t &agrave; la mode depuis quelques ann&eacute;es. Nous avons donc contact&eacute; l&rsquo;&eacute;quipe d&rsquo;Evive afin qu&rsquo;ils nous parlent de leurs produits et qu&rsquo;ils nous racontent comment l&rsquo;entreprise est n&eacute;e.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" height=\"274\" src=\"https://www.alternateeve.com/upload/redactor_upload_images/1504053575_IMG_20170511_120011%20copie.jpg\" title=\"\" width=\"205\" /></p>\r\n\r\n<p>L&rsquo;id&eacute;e de lancer des smoothies en cubes sur le march&eacute; est venu pendant les ann&eacute;es d&rsquo;universit&eacute; de la fondatrice Claudia Poulin. L&rsquo;alimentation &eacute;tait un sujet tr&egrave;s important pour elle. Elle voulait manger sainement et une des fa&ccedil;on d&rsquo;y arriver &eacute;tait de se faire des smoothies. Avec son conjoint, Dominic Dub&eacute;, ils ont eu l&rsquo;id&eacute;e des cubes afin de partager une fa&ccedil;on rapide de bien s&rsquo;alimenter avec un grand nombre de personnes. Selon eux, leur formule offre aux gens une fa&ccedil;on simple et rapide de bien manger, ce qui leur permet &eacute;galement de profiter de la vie. De l&agrave; provient leur slogan : &ldquo;Evive ta vie/More from life&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Partager leur vision de la sant&eacute; est un &eacute;l&eacute;ment cl&eacute; de leurs id&eacute;es. Les valeurs tel que le bien-&ecirc;tre, le partage et l&rsquo;harmonie ont une place centrale dans leur compagnie.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Claudia et Dominic souhaiteraient faire passer le message suivant avec leur compagnie:</p>\r\n\r\n<p>&ldquo;FAST FOOD DOESN&#39;T MEAN JUNK FOOD. Notre produit offre un fa&ccedil;on &quot;fast food&quot;, sans &ecirc;tre n&eacute;faste pour la sant&eacute;, c&#39;est m&ecirc;me b&eacute;n&eacute;fique &ldquo; - Claudia Poulin</p>\r\n\r\n<p><img alt=\"\" height=\"140\" src=\"https://www.alternateeve.com/upload/redactor_upload_images/1504053647_unnamed%20copie.jpg\" title=\"\" width=\"212\" /></p>\r\n\r\n<p>Les smoothies d&rsquo;Evive sont fait avec des ingr&eacute;dients biologiques. Ils sont pr&eacute;par&eacute;s au Qu&eacute;bec et lorsque possible, la compagnie&nbsp;utilise des produits locaux. &nbsp;Trois recettes de smoothies sont pr&eacute;sentement disponibles : Le guerrier (framboises, fraises, betterave, graines de chia), le touk-touk (mangue, ananas, abricot, noix de coco) et le yogi (banane, &eacute;pinard, poire, kale, graine de chanvre). Des prot&eacute;ines v&eacute;g&eacute;tales ont &eacute;t&eacute; ajout&eacute; &agrave; chacune des recettes &agrave; la demande des clients.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>En allant sur le site internet de la compagnie&nbsp;<a href=\"http://www.evivesmoothie.com/\" target=\"_blank\">Evive</a>, vous trouverez la liste compl&egrave;te des ingr&eacute;dients et &eacute;galement les points de ventes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bon smoothie!</p>\r\n\r\n<p>&nbsp;</p>',5,'2017-12-14-15-49-07-2017-08-30-00-19-33-18268404_1784018018581317_3005372520109564707_n copie.jpg',2,1,1,'Evive - Cubes de smoothies','Evive - Cubes de smoothies','RÃ©cemment, nous discutions des faÃ§ons dâavoir Ã  la fois une bonne alimentation et de gagner du temps le matin. En fouillant sur internet, nous avons dÃ©couvert la compagnie Evive.','RÃ©cemment, nous discutions des faÃ§ons dâavoir Ã  la fois une bonne alimentation et de gagner du temps le matin. En fouillant sur internet, nous avons dÃ©couvert la compagnie Evive.','Evive smoothies','Evive smoothies','Evive - Cubes de smoothies','Evive - Cubes de smoothies','RÃ©cemment, nous discutions des faÃ§ons dâavoir Ã  la fois une bonne alimentation et de gagner du temps le matin. En fouillant sur internet, nous avons dÃ©couvert la compagnie Evive.','RÃ©cemment, nous discutions des faÃ§ons dâavoir Ã  la fois une bonne alimentation et de gagner du temps le matin. En fouillant sur internet, nous avons dÃ©couvert la compagnie Evive.','2017-06-09 01:13:56','2017-12-14 23:49:07','2017-07-01'),(5,'Sarah dans la lune - Ãcodesign mode','Sarah dans la lune - Ãcodesign mode','<p><em>This post is not available in english for the moment.&nbsp;</em></p>\r\n\r\n<p><em>French version below:</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pour notre premier article, nous sommes all&eacute;s &agrave; la rencontre de Sarah dans la lune, alias Sarah Girouard.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px\"><img alt=\"\" height=\"318\" src=\"http://142.44.142.26/upload/redactor_upload_images/1503880392_IMG_2072.JPG\" title=\"\" width=\"239\" /></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sur son&nbsp;<a href=\"https://sarahdanslalune.com/\" target=\"_blank\">site internet,</a>&nbsp;la jeune cr&eacute;atrice montr&eacute;alaise vous propose des articles utilitaires et de modes fait avec des cravates recycl&eacute;es qu&rsquo;elle d&eacute;niche dans des friperies. Elle cr&eacute;e des fanny packs, des &eacute;tuis &agrave; maquillage et des noeuds papillons avec ses trouvailles. D&rsquo;ailleurs, elle peut cr&eacute;er jusqu&rsquo;&agrave; quatre items avec une seule cravate!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>L&rsquo;id&eacute;e de cr&eacute;er son entreprise d&rsquo;&eacute;co-design lui est venu en janvier 2016. Rapidement, elle sort sa premi&egrave;re collection au mois de mai suivant. Le recyclage de mat&eacute;riel est r&eacute;ellement le centre de son projet. Les cravates moins jolies servent de doublure et elle se sert de boutons r&eacute;cup&eacute;r&eacute;s sur ses cr&eacute;ations.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Lorsqu&rsquo;elle pense au futur, Sarah aimerait cr&eacute;er un site internet o&ugrave; les personnes peuvent personnaliser et commander un produit selon les tissus et mat&eacute;riaux disponibles. Elle souhaiterait &eacute;galement agrandir son &eacute;quipe afin d&rsquo;avoir du personnel qui s&rsquo;occuperait du c&ocirc;t&eacute; administratif et de la communication.</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>Si votre curiosit&eacute; a &eacute;t&eacute; piqu&eacute;e, vous pouvez trouver les produits de Sarah dans la lune sur son site internet ou &agrave; la boutique L&rsquo;empreinte coop&eacute;rative au vieux Montr&eacute;al sur la rue Saint-Paul. Elle participera &eacute;galement &agrave; &nbsp;la&nbsp;<a href=\"https://www.facebook.com/events/443885182627548/\" target=\"_blank\">&ldquo;Vente priv&eacute;e et soir&eacute;e de personnalisation mode&rdquo;</a><a href=\"https://www.facebook.com/events/443885182627548/\" target=\"_blank\">&nbsp;</a>organis&eacute;e par l&rsquo;Avenue du Mont-Royal le 3 mai prochain &agrave; la boutique Adam &amp; &Egrave;ve o&ugrave; vous pourrez fabriquer des boucles pour cheveux et des noeuds papillons avec elle.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bon magasinage!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;&nbsp;&nbsp;<img alt=\"\" height=\"294\" src=\"http://142.44.142.26/upload/redactor_upload_images/1503877109_aa.JPG\" width=\"221\" />&nbsp;.&nbsp;<img alt=\"\" height=\"294\" src=\"http://142.44.142.26/upload/redactor_upload_images/1503877109_a.JPG\" width=\"225\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" height=\"324\" src=\"http://142.44.142.26/upload/redactor_upload_images/1503877109_14910491_10154120801556588_410466007101138986_n.jpg\" title=\"\" width=\"323\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Vous pouvez aussi d&eacute;couvrir ses cr&eacute;ations sur sa page&nbsp;<a href=\"https://www.facebook.com/sarahdanslalune/\" target=\"_blank\">Facebook</a></p>\r\n\r\n<p>&nbsp;</p>','<p>Pour notre premier article, nous sommes all&eacute;s &agrave; la rencontre de Sarah dans la lune, alias Sarah Girouard.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px\"><img alt=\"\" height=\"318\" src=\"http://142.44.142.26/upload/redactor_upload_images/1503880392_IMG_2072.JPG\" title=\"\" width=\"239\" /></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sur son&nbsp;<a href=\"https://sarahdanslalune.com/\" target=\"_blank\">site internet,</a>&nbsp;la jeune cr&eacute;atrice montr&eacute;alaise vous propose des articles utilitaires et de modes fait avec des cravates recycl&eacute;es qu&rsquo;elle d&eacute;niche dans des friperies. Elle cr&eacute;e des fanny packs, des &eacute;tuis &agrave; maquillage et des noeuds papillons avec ses trouvailles. D&rsquo;ailleurs, elle peut cr&eacute;er jusqu&